import React from 'react';
import { Link } from 'react-router-dom';

import './Components.scss';

const Navbar = () => {
    return (
        <div>
            <div className="logo">
                <h1>EXERCISE </h1>
                <h1>LOG.</h1>
            </div>
            <ul>
                <li>
                    <Link to="/exercises">
                        Exercise Lists
                    </Link>
                </li>
            </ul>
        </div>
    )
};

export default Navbar;
